  // eslint-disable-next-line @angular-eslint/directive-selector\n    selector: ` [mat-fab]:not([${DISABLE_AUTO_ACCESSIBLE_LABEL_ATTRIBUTE}]),\n                [mat-mini-fab]:not([${DISABLE_AUTO_ACCESSIBLE_LABEL_ATTRIBUTE}]),\n                [mat-icon-button]:not([${DISABLE_AUTO_ACCESSIBLE_LABEL_ATTRIBUTE}]),\n                mat-icon[tabindex]:not([${DISABLE_AUTO_ACCESSIBLE_LABEL_ATTRIBUTE}])`,\n})\nexport class UiAutoAccessibleLabelDirective {\n    @HostBinding('attr.aria-label')\n    @Input()\n    matTooltip?: string;\n\n    constructor(\n        elementRef: ElementRef,\n        @Optional() tooltip?: MatTooltip,\n    ) {\n        if (!tooltip) {\n            console.warn(MAT_TOOLTIP_MISSING_WARNING, elementRef.nativeElement);\n        }\n    }\n}\n\n    \n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n                   \n    \n         results matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"modules/UiAutoAccessibleLabelModule.html":{"url":"modules/UiAutoAccessibleLabelModule.html","title":"module - UiAutoAccessibleLabelModule","body":"\n                   \n\n\n\n\n    Modules\n    UiAutoAccessibleLabelModule\n\n\n\n    \n        \n\n\n\n\n\ndependencies\n\ndependencies\n\ncluster_UiAutoAccessibleLabelModule\n\n\n\ncluster_UiAutoAccessibleLabelModule_exports\n\n\n\ncluster_UiAutoAccessibleLabelModule_declarations\n\n\n\n\nUiAutoAccessibleLabelDirective\n\nUiAutoAccessibleLabelDirective\n\n\n\nUiAutoAccessibleLabelModule\n\nUiAutoAccessibleLabelModule\n\nUiAutoAccessibleLabelModule -->\n\nUiAutoAccessibleLabelDirective->UiAutoAccessibleLabelModule\n\n\n\n\n\nUiAutoAccessibleLabelDirective \n\nUiAutoAccessibleLabelDirective \n\nUiAutoAccessibleLabelDirective  -->\n\nUiAutoAccessibleLabelModule->UiAutoAccessibleLabelDirective \n\n\n\n\n\n\n    \n    \n    \n        Zoom in\n        Reset\n        Zoom out\n    \n\n\n\n\n\n    \n        Info\n    \n    \n        Source\n    \n\n\n\n    \n\n        \n            File\n        \n        \n          